### Describe the issue

I use `onnxmltools` to convert a LightGBM model to an onnx file through `convert_lightgbm`. I can run this model using the ONNX runtime in Python. However, I got an error  "Can't access output tensor data. error code = 1." when I tried to inference it using ONNX runtime web.

### To reproduce

The model can be found in this [dropbox](https://www.dropbox.com/s/voiow5v071pq7hy/model.onnx?dl=0).

I followed [the example](https://github.com/microsoft/onnxruntime-inference-examples/blob/main/js/quick-start_onnxruntime-web-bundler/main.js) to run ONNX runtime in browser.

```typescript
try {
  // Create a new session and load the LightGBM model
  const session = await ort.InferenceSession.create(modelUrl);

  const x = Float32Array.from(new Array(31).fill(0));

  // Prepare feeds. use model input names as keys.
  const xTensor = new ort.Tensor('float32', x, [1, 31]);
  const feeds = { float_input: xTensor };

  // Feed inputs and run
  const results = await session.run(feeds);

  this.message = `Success: ${results}`;
} catch (e) {
  this.message = `Failed: ${e}.`;
}
```

